    def GetAtomicNumber(self, sym):
        for n in range(0, len(self.symbol)):
            if self.symbol[n] == sym: return n
        return 0

    def GetSymbol(self, n):         return self.symbol[n]
    def GetName(self, n):           return self.name[n]
    def GetAtomicMass(self, n):     return self.mass[n]
    def GetCovalentRadius(self, n): return self.Rcovalent[n]
    def GetVdWRadius(self, n):      return self.Rvdw[n]
    def GetMeltingPoint(self, n):   return self.Tm[n]
    def GetBoilingPoint(self, n):   return self.Tb[n]
    def GetCrystalStructure(self, n): return self.structure[n]
    def GetCellParameters(self, n):
        return [self.lp_a[n], self.lp_b[n], self.lp_c[n],\
                self.lp_alpha[n], self.lp_beta[n], self.lp_gamma[n]]
    def GetCPKColor(self, n): return self.cpkcolor[n]
